/*Table structure for table `tc_carrinho` */

DROP TABLE IF EXISTS `tc_carrinho`;

CREATE TABLE `tc_carrinho` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `cd_carrinho` varchar(255) DEFAULT NULL COMMENT 'Chave do carrinho contendo nome do cliente mais um sequencial',
  `cd_pagseguro` varchar(255) DEFAULT NULL,
  `sq_carrinho` int(5) DEFAULT NULL COMMENT 'Sequencia',
  `cd_sit` varchar(2) DEFAULT NULL COMMENT 'AB: Aberto, EV: Enviado, PG:Pago, CA: Cancelado, FI: Finalizado',
  `cd_sit_pagseguro` int(10) DEFAULT '0' COMMENT '1: Aguardando pagamento, 2: Em analise, 3: Paga, 4: Disponível, 5: Disputa, 6: Devolvida, 7: Cancelada',
  `cd_pagamento` varchar(10) DEFAULT NULL COMMENT 'Tipo de pagamento usado',
  `nu_itens` int(10) DEFAULT NULL COMMENT 'Quantidade de itens total do carrinho',
  `id_cliente` int(10) DEFAULT NULL,
  `id_pstransaction` int(10) DEFAULT NULL COMMENT 'Identificador da notificação do pag seguro',
  `id_coleta` int(10) DEFAULT NULL COMMENT 'Descrição dos dados de envio da mercadoria',
  `id_end_entrega` int(10) DEFAULT NULL,
  `vl_item` decimal(10,2) DEFAULT NULL,
  `vl_adicional` decimal(10,2) DEFAULT NULL,
  `vl_taxas` decimal(10,2) DEFAULT NULL,
  `vl_desconto` decimal(10,2) DEFAULT NULL,
  `vl_frete` decimal(10,2) DEFAULT NULL,
  `vl_total` decimal(10,2) DEFAULT NULL,
  `cd_nf` varchar(20) DEFAULT NULL,
  `tx_obs` text,
  `dt_criacao` date DEFAULT NULL,
  `hr_criacao` time DEFAULT NULL,
  `dt_fechamento` date DEFAULT NULL,
  `hr_fechamento` time DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `cliente_carrinho` (`id_cliente`),
  KEY `endereco_carrinho` (`id_end_entrega`),
  CONSTRAINT `cliente_carrinho` FOREIGN KEY (`id_cliente`) REFERENCES `tc_clientes` (`id`) ON DELETE NO ACTION ON UPDATE CASCADE,
  CONSTRAINT `endereco_carrinho` FOREIGN KEY (`id_end_entrega`) REFERENCES `tc_clientes_enderecos` (`id`) ON DELETE NO ACTION ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=68 DEFAULT CHARSET=latin1;

