/*Table structure for table `tc_produtos` */

DROP TABLE IF EXISTS `tc_produtos`;

CREATE TABLE `tc_produtos` (
  `id` int(8) NOT NULL AUTO_INCREMENT,
  `nm_produto` varchar(255) DEFAULT NULL COMMENT 'Nome do produto',
  `cd_produto` varchar(50) DEFAULT NULL COMMENT 'Código de fabricante',
  `de_curta` text COMMENT 'Descrição curta',
  `de_longa` text COMMENT 'Descrição Longa',
  `cd_status` varchar(1) DEFAULT NULL COMMENT 'A: Ativo I: Inativo',
  `nu_cliques` int(10) DEFAULT NULL COMMENT 'Contador',
  `nm_pronuncia` varchar(255) DEFAULT NULL COMMENT 'Sound PHP',
  `id_tipo` int(8) DEFAULT NULL,
  `id_fabricante` int(8) DEFAULT NULL COMMENT 'Um fabricante para cada produto',
  `id_categoria` int(8) DEFAULT NULL COMMENT 'Uma categoria para cada produto',
  `tx_link` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=238 DEFAULT CHARSET=latin1;

