insert  into `tc_produtos`(`id`,`nm_produto`,`cd_produto`,`de_curta`,`de_longa`,`cd_status`,`nu_cliques`,`nm_pronuncia`,`id_tipo`,`id_fabricante`,`id_categoria`,`tx_link`) values (175,'Onda Reggae','','<p>O governo do Congo anunciou neste domingo.</p>','<p>O governo do Congo anunciou neste domingo que não vai negociar com os\r\n rebeldes do M23, até que eles saiam da cidade de Goma, mas um porta-voz\r\n rebelde disse que Kinshasa não estava em posição de estabelecer \r\ncondições em negociações de paz.</p>','A',0,'O536',0,23,22,'onda-reggae-175/'),(177,'Luiggi','','adsasd','adad','A',0,'L200',0,25,20,'luiggi-177/'),(178,'Escada Marinha','365','3456','3456','A',0,'E235',0,27,20,'escada-marinha-178/'),(179,'Ninho Passarinho','24','34','234','A',0,'N512',0,28,18,'ninho-passarinho-179/'),(180,'Óleo Vegetal','','123','<ul><li>123</li></ul>','A',0,'L123',0,23,0,'oleo-vegetal-180/'),(182,'Pimenta Amarela','','123','123','A',0,'P553',0,23,0,'pimenta-amarela-182/'),(183,'Erva Doce','EV444$','123','123','A',0,'E613',0,25,23,'erva-doce-183/'),(194,'Tempero Amarelo','4567','4567','4567','A',0,'T516',0,23,0,'tempero-amarelo-194/'),(200,'Sopa de temperos','4352345','2345245','345','A',0,'S133',0,26,0,'sopa-de-temperos-200/'),(201,'Ardida','4352345','O problema é que quem navega por perfis feitos só de alegrias e bons momentos acaba chamuscado. Um estudo de duas universidades alemãs, divulgado em janeiro, revelou que mais de um terço dos usuários DO Facebook enfrenta sentimentos negativos, como frustração, depois de visitar os perfis dos amigos.<br><br>Os pesquisadores concluíram que a exposição a cenas explícitas de sucesso e lazer transformou a inveja em moeda corrente na rede social, conduzindo a um clima de insatisfação com a própria vida.','345','A',0,'A633',0,26,22,'ardida-201/'),(202,'Pimenta de Salmão','4352345','2345245','345','A',0,'P553',0,26,0,NULL),(204,'Salsinha Amarela','','<p>Amparado pelo grupo de compositores The Smeezingtons, Mars decolou \r\nnas paradas, ganhou