PA-33343','asdsgsdgsd','sdfgsdfg','A',0,'M215',0,25,26,'mix-pimentas-amarelas-218/'),(219,'Mix de Temperos','PMV123123','asdadfadsf','A direção gremista estuda a possibilidade de reabrir o Estádio Olímpico \r\npara os jogos que serão disputados no mês de janeiro. O motivo da \r\nreabertura do antigo estádio é porque a Arena, nova casa tricolor, ainda\r\n não está com condições ideais para abrigar partidas.','A',0,'M233',0,26,26,'mix-de-temperos-219/'),(220,'Pimenta Branca','PB999','gfsdfg','A direção gremista estuda a possibilidade de reabrir o Estádio Olímpico \r\npara os jogos que serão disputados no mês de janeiro. O motivo da \r\nreabertura do antigo estádio é porque a Arena, nova casa tricolor, ainda\r\n não está com condições ideais para abrigar partidas.','A',0,'P553',0,26,26,'pimenta-branca-220/'),(221,'Salsinha Verde','SV','asdasd','A direção gremista estuda a possibilidade de reabrir o Estádio Olímpico \r\npara os jogos que serão disputados no mês de janeiro. O motivo da \r\nreabertura do antigo estádio é porque a Arena, nova casa tricolor, ainda\r\n não está com condições ideais para abrigar partidas.','A',0,'S425',0,26,26,'salsinha-verde-221/'),(222,'Pimenta Rosa','PR453454','weqeqweqwe','principal preocupação da direção gremista é em relação ao gramado da \r\nArena, que ainda não se encontra nas condições ideais para a prática do \r\nfutebol. Uma avaliação mais criteriosa em relação ao campo será feita \r\napós o jogo treino desta quinta-feira, entre Grêmio e Canoas.\r\n<p>\r\n	“Vamos avaliar o gramado após o treino de hoje e se a gente constatar \r\nque está ruim ai vamos jogar as duas primeiras partidas do Campeonato \r\nGaúcho no Estádio Olímpico para poder no dia 30 de janeiro poder \r\nenfrentar a LDU aqui na Arena”, disse Eduardo Antonini, representante da\r\n Grêmio empreendimentos.</p>\r\n<p>\r\n	As partidas que poderão ocorrer no Estádio Olímpico são contra o \r\nCanoas, dia 24 de janeiro e Santa Cruz, dia 26 de janeiro. Por questões \r\ncontratuais o Grêmio tem que entregar para a construtora OAS o Estádio \r\nOlímpico no mês de março.</p>','A',0,'P553',0,34,26,'pimenta-rosa-222/'),(223,'Salvia','SAL-24352','dsfsdf','principal preocupação da direção gremista é em relação ao gramado da \r\nArena, que ainda não se encontra nas condições ideais para a prática do \r\nfutebol. Uma avaliação mais criteriosa em relação ao campo será feita \r\napós o jogo treino desta quinta-feira, entre Grêmio e Canoas.\r\n<p>\r\n	“Vamos avaliar o gramado após o treino de hoje e se a gente constatar \r\nque está ruim ai vamos jogar as duas primeiras partidas do Campeonato \r\nGaúcho no Estádio Olímpico para poder no dia 30 de janeiro poder \r\nenfrentar a LDU aqui na Arena”, disse Eduardo Antonini, representante da\r\n Grêmio empreendimentos.</p>\r\n<p>\r\n	As partidas que poderão ocorrer no Estádio Olímpico são contra o \r\nCanoas, dia 24 de janeiro e Santa Cruz, dia 26 de janeiro. Por questões \r\ncontratuais o Grêmio tem que entregar para a construtora OAS o Estádio \r\nOlímpico no mês de março.</p>','A',0,'S410',0,29,26,'salvia-223/'),(224,'Tempero Misto','TM-8484','dafsadf','principal preocupação da direção gremista é em relação ao gramado da \r\nArena, que ainda não se encontra nas condições ideais para a prática do \r\nfutebol. Uma avaliação mais criteriosa em relação ao campo será feita \r\napós o jogo treino desta quinta-feira, entre Grêmio e Canoas.\r\n<p>\r\n	“Vamos avaliar o gramado após o treino de hoje e se a gente constatar \r\nque está ruim ai vamos jogar as duas primeiras partidas do Campeonato \r\nGaúcho no Estádio Olímpico para poder no dia 30 de janeiro poder \r\nenfrentar a LDU aqui na Arena”, disse Eduardo Antonini, representante da\r\n Grêmio empreendimentos.</p>\r\n<p>\r\n	As partidas que poderão ocorrer no Estádio Olímpico são contra o \r\nCanoas, dia 24 de janeiro e Santa Cruz, dia 26 de janeiro. Por questões \r\ncontratuais o Grêmio tem que entregar para a construtora OAS o Estádio \r\nOlímpico no mês de março.</p>','A',0,'T516',0,29,26,'tempero-misto-224/'),(225,'Tempero Tradicional','TT-00393','dfsgsdfgsdfg','principal preocupação da direção gremista é em relação ao gramado da \r\nArena, que ainda não se encontra nas condições ideais para a prática do \r\nfutebol. Uma avaliação mais criteriosa em relação ao campo será feita \r\napós o jogo treino desta quinta-feira, entre Grêmio e Canoas.\r\n<p>\r\n	“Vamos avaliar o gramado após o treino de hoje e se a gente constatar \r\nque está ruim ai vamos jogar as duas primeiras partidas do Campeonato \r\nGaúcho no Estádio Olímpico para poder no dia 30 de janeiro poder \r\nenfrentar a LDU aqui na Arena”, disse Eduardo Antonini, representante da\r\n Grêmio empreendimentos.</p>\r\n<p>\r\n	As partidas que poderão ocorrer no Estádio Olímpico são contra o \r\nCanoas, dia 24 de janeiro e Santa Cruz, dia 26 de janeiro. Por questões \r\ncontratuais o Grêmio tem que entregar para a construtora OAS o Estádio \r\nOlímpico no mês de março.</p>','A',0,'T516',0,26,26,'tempero-tradicional-225/'),(226,'Kit de Temperos','KTM-933','dfsdfsadf','principal preocupação da direção gremista é em relação ao gramado da \r\nArena, que ainda não se encontra nas condições ideais para a prática do \r\nfutebol. Uma avaliação mais criteriosa em relação ao campo será feita \r\napós o jogo treino desta quinta-feira, entre Grêmio e Canoas.\r\n<p>\r\n	“Vamos avaliar o gramado após o treino de hoje e se a gente constatar \r\nque está ruim ai vamos jogar as duas primeiras partidas do Campeonato \r\nGaúcho no Estádio Olímpico para poder no dia 30 de janeiro poder \r\nenfrentar a LDU aqui na Arena”, disse Eduardo Antonini, representante da\r\n Grêmio empreendimentos.</p>\r\n<p>\r\n	As partidas que poderão ocorrer no Estádio Olímpico são contra o \r\nCanoas, dia 24 de janeiro e Santa Cruz, dia 26 de janeiro. Por questões \r\ncontratuais o Grêmio tem que entregar para a construtora OAS o Estádio \r\nOlímpico no mês de março.</p>','A',0,'K335',0,29,26,'kit-de-tem