/*Table structure for table `tc_promocoes` */

DROP TABLE IF EXISTS `tc_promocoes`;

CREATE TABLE `tc_promocoes` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `nm_promocao` varchar(100) DEFAULT NULL,
  `de_promocao` text,
  `id_desconto` int(10) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `id_desconto` (`id_desconto`),
  CONSTRAINT `tc_promocoes_ibfk_1` FOREIGN KEY (`id_desconto`) REFERENCES `tc_descontos` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `tc_promocoes` */

/*Table structure for table `tc_pstransaction` */

DROP TABLE IF EXISTS `tc_pstransaction`;

CREATE TABLE `tc_pstransaction` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `dt_criacao` date DEFAULT NULL COMMENT 'Data da criação da transação',
  `lastEventDate` date DEFAULT NULL COMMENT 'Data do último evento da transação',
  `cd_codigo` varchar(40) DEFAULT NULL COMMENT 'Código identificador da transação',
  `reference` varchar(250) DEFAULT NULL COMMENT 'Código de referência da transação',
  `cd_tipo` int(2) DEFAULT NULL COMMENT 'Tipo da transação',
  `cd_status` int(2) DEFAULT NULL COMMENT 'Status da transação',
  `cancellationSource` varchar(20) DEFAULT NULL COMMENT 'Origem do cancelamento',
  `paymentMethod_type` int(1) DEFAULT NULL COMMENT 'Tipo do meio de pagamento',
  `paymentMethod_code` int(3) DEFAULT NULL COMMENT 'Código identificador do meio de pagamento',
  `grossAmount` decimal(10,2) DEFAULT NULL COMMENT 'Valor bruto da transação',
  `discountAmount` decimal(10,2) DEFAULT NULL COMMENT 'Valor do desconto',
  `feeAmount` decimal(10,2) DEFAULT NULL COMMENT 'Valor total das taxas cobradas',
  `netAmount` decimal(10,2) DEFAULT NULL COMMENT 'Valor líquido da transação',
  `extraAmount` decimal(10,2) DEFAULT NULL COMMENT 'Valor extra da transação',
  `installmentCount` int(10) DEFAULT NULL COMMENT 'Número de parcelas que o comprador escolheu no pagamento com cartão de crédito',
  `itemCount` int(10) DEFAULT NULL COMMENT 'Aponta o número de itens contidos nesta transação',
  `sender_email` varchar(100) DEFAULT NULL COMMENT 'Email do comprador',
  `shipping_type` varchar(100) DEFAULT NULL COMMENT 'Tipo de frete',
  `shipping_cost` decimal(10,2) DEFAULT NULL COMMENT 'Custo total do frete',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `tc_pstransaction` */

/*Table structure for table `tc_tags` */

