  `tx_sound` varchar(100) DEFAULT NULL,
  `nu_visualizacoes` int(8) DEFAULT NULL,
  `cd_tipo` char(2) DEFAULT NULL,
  `de_tag` text,
  `tx_meta_title` varchar(255) DEFAULT NULL,
  `tx_meta_description` text,
  `tx_keywords` text,
  `tx_link` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id`)
