insert  into `tcctd_blocos`(`id`,`nm_bloco`,`de_bloco`,`tx_conteudo`,`cd_bloco`,`tp_secao`,`tx_arq_css`) values (1,'Pagamento Pag seguro','Aviso antes do usuário ser direcionado ao site do Pag Seguro para pagamento','<div id=\"features\">\r\n<img src=\"http://localhost/Mercadodossabores/comum/imagens/estrutura/logo-pag-seguro.gif\" alt=\"PagSeguro\">\r\n   <h3>Com o PagSeguro, o comprador tem inúmeras vantagens:</h3>\r\n   <div class=\"feature\">\r\n      <span class=\"icon\">Pagamento Seguro</span>\r\n      <dl>\r\n         <dt>Pagamento Seguro</dt>\r\n         <dd>\r\n            Você tem 14 dias para bloquear o pagamento caso o produto não seja entregue, ou não esteja de acordo com o combinado.\r\n         </dd>\r\n      </dl>\r\n   </div>\r\n   <div class=\"feature\">\r\n      <span class=\"icon\">Proteção de dados</span>\r\n      <dl>\r\n         <dt>Proteja seus dados financeiros</dt>\r\n         <dd>\r\n            Compre sem informar o número do seu cartão de crédito para as lojas.\r\n         </dd>\r\n      </dl>\r\n   </div>\r\n   <div class=\"feature\">\r\n      <span class=\"icon\">Parcelamento</span>\r\n      <dl>\r\n         <dt>Pague como quiser!</dt>\r\n         <dd>\r\n            Utilize o meio de pagamento de sua preferência e ainda parcele suas compras no cartão em até 18x.\r\n         </dd>\r\n      </dl>\r\n   </div>\r\n   <div class=\"feature\">\r\n      <span class=\"icon\">Conta</span>\r\n      <dl>\r\n         <dt>Facilidade e rapidez em suas compras</dt>\r\n         <dd>Com uma conta PagSeguro, você compra apenas com seu e-mail e senha.</dd>\r\n      </dl>\r\n   </div>\r\n   <div class=\"feature\">\r\n      <span class=\"icon\">TodaOferta</span>\r\n      <dl>\r\n         <dt>Compre no TodaOferta com PagSeguro</dt>\r\n         <dd>\r\n            Compre em milhares de lojas sem preocupações.\r\n         </dd>\r\n      </dl>\r\n   </div>\r\n   <div class=\"feature\">\r\n      <span class=\"icon\">Gratuito</span>\r\n      <dl>\r\n         <dt>É grátis!</dt>\r\n         <dd>Você não precisa pagar nenhuma taxa para comprar com PagSeguro.</dd>\r\n      </dl>\r\n   </div>\r\n</div>','AVISO_PAGSEGURO',NULL,NULL),(2,'Explicação Redirecionamento Pag Seguro','Explicação Redirecionamento Pag Seguro','Mercado dos Sabores utiliza um meio seguro de pagamento reconhecido em todo o Brasil por sua segurança e simplicidade de uso.<br /><br />\r\nClique no botão abaixo e acesse o site do PagSeguro para efetuar o pagamento, após esta etapa, você retornará ao site Mercado dos Sabores.','AVISO_REDIR_PAGSEGURO',NULL,NULL);

