insert  into `tcctd_htmlgeral`(`id`,`nm_pagina`,`tx_conteudo`,`tx_meta_titu`,`de_meta_tag`,`tx_tags`,`tx_link`,`tp_secao`,`tx_arq_css`) values (10,'GGGG','','','','','gggg/','divulgacao',''),(14,'Pimentas baianas','','','','','pimentas-baianas/','divulgacao',''),(15,'gsdfgsdfgsd','','','','','gsdfgsdfgsd/','conteudo',''),(21,'qwerqr','','','','','qwerqr/','divulgacao',''),(22,'Pimentas Santo Antonio','','','','','pimentas-santo-antonio/','conteudo',''),(24,'asdad','','','','','asdad/','divulgacao',''),(29,'Papas da lingua','asdfasdfasfa','Veja como é fácil','fsdfasf','asfasdf','papas-da-lingua/','divulgacao',''),(30,'Quem somos','História<br>&nbsp;&nbsp; Desde a sua criação, o ShopB tem como foco principal prestar um serviço de e-commerce de qualidade, sofisticação e diferenciado, oferecendo produtos de qualidade e trazendo qualidade de vida e consumidores satisfeitos, cativados ao longo dessa trajetória. Nossa Central de Relacionamento é formada por pessoas com foco no consumidor, que não descansam até entender se as necessidades dos clientes foram plenamente atendidas. Ela está preparada para orientar as compras e auxiliar em todas as questões. O ShopB conta ainda com um centro de distribuição na região de metropolitana de Curitiba, mais precisamente em Araucária, atuando com 100% de automatização e utilizando processos e tecnologias de ponta em sua gestão, garantindo assim a entrega dos produtos com total agilidade, segurança e qualidade.<br><br>Visão<br>&nbsp;&nbsp; Estarmos dentro os melhores serviços de e-commerce da internet brasileira, trabalhando em todas as frentes: loja, call center, logística e distribuição, com uma taxa de erro zero.<br><br>Missão<br>&nbsp;&nbsp; Nossa razão de existir é prestar aos clientes um serviço impecável, de forma sempre amigável e socorrendo-os em todas as suas necessidades.<br><br>Valores<br>&nbsp;&nbsp; Respeito aos nossos clientes, funcionários e fornecedores. Atuação idônea em todos os níveis, na certeza de que só ações pautadas na transparência fazem empresas duradouras. Pensamento grande, sem perder o foco nos detalhes. ','Quem Somos','quem somos','consoles, games, informatica, modem, wii, xbox360, destravado, playstation, frete, pendrive, jogos, preço, loja, virtual, eletronico, curitiba, xbox, video, computador, pc, vezes, cartão, araucária','quem-somos/','conteudo',''),(31,'Sapatos Gaúchos','','','','','sapatos-gauchos/','conteudo',''),(32,'testeteste','wer wer wer we rwe rwer ','wtwer','werwerwer wer ','wer wer wer wr ','testeteste/','conteudo',''),(33,'bim bom','','','','','bim-bom/','conteudo',''),(35,'Natal','','','','','natal/','conteudo',''),(37,'Sobre nós','','','','','sobre-nos/','conteudo',''),(40,'Qual é a melhor pimenta','','','','','qual-e-a-melhor-pimenta/','divulgacao',''),(41,'hgf','','','','','hgf/','conteudo',''),(42,'231','','','','','231/','conteudo',''),(43,'asd','','','','','asd/','conteudo',''),(44,'dsfg','','','','','dsfg/','conteudo',''),(45,'dfghsdfg','','','','','dfghsdfg/','conteudo',''),(46,'tete44','456745674567','45674567','46745674','4567467','tete44/','conteudo',''),(47,'etyerty','76574','4567','90-=90-=','456','etyerty/','conteudo',''),(48,'Sobre a Loja','<h1>Quem somos?</h1>Fundada em 1981, a Centauro é maior rede de lojas de produtos esportivos da América Latina.<br>Com atuação nos principais shoppings do país, a rede desenvolveu e implantou, de forma pioneira, o conceito de super e megastore que reúne, dentro de um único ambiente, várias categorias de esportes, além de entretenimento e experimentação de produtos. Ao todo, são 133 lojas distribuídas em vários estados do Brasil.<br>A marca também é a patrocinadora dos tenistas Marcelo Melo, André Sá, Bruno Soares e do técnico Daniel Melo, além do judoca João Derly.','Quem Somos','Saiba quem esta por trás do Mercado dos Sabores','mercado dos sabores, pimentas, quem somos','sobre-a-loja/','divulgacao',''),(49,'Atendimento','<h2>Telefone:</h2><p>(51) 3362-8228<br></p><h2>Email:</h2><p>contato@mercadodossabores.com.br<br></p><h2>Skype:</h2><p>mercadodossabores<br></p><h2>Celular:</h2><p>(51) 82286475 - Vivo</p><p>(51) 9682-2854 - Claro<br></p>','Atendimento','Entre em contaco conosco, teremos maior prazer em atendê-lo','contato, atendimento mercado dos sabores','atendimento/','divulgacao',''),(50,'Política de Troca','Todas as ocorrências que envolvam troca ou devolução devem ser comunicadas à Central de Atendimento ao Cliente.<br><br><br>Produto devolvido sem essa comunicação, fora do prazo ou com ausência de itens/acessórios que o acompanham, será reenviado ao cliente pela empresa.<br><br><br>Os produtos não sofrem qualquer alteração em nosso Centro de Distribuição: eles são enviados ao cliente exatamente como nos foram entregues pelo fabricante.<br><br><br>Se ocorrer qualquer das hipóteses abaixo, recuse o recebimento do produto:<br><br><br>Embalagem aberta ou avariada;<br>Produto avariado;<br>Produto em desacordo com o pedido;<br>Falta de acessórios.<br><br>Se, ainda assim, você receber o produto, por favor entre em contato com a nossa Central de Atendimento ao Cliente em até 72h.','Política de trocas','Conheça a nossa política de troca de produtos','troca de produtos','politica-de-troca/','divulgacao',''),(51,'Serviços','Os principais produtos são a carne de rã inteira e em corte (coxas de Rã) e a venda de animais vivos para estudo em universidades e centros de pesquisa do estado.<br><br><br>A empresa Ranasul comercializa seus produtos para redes de restaurantes, mercados de produtos especiais, açougues especializados e em redes de hipermercados. Você pode saber mais sobre nossos pontos de venda na página onde encontrar.<br><br><br>A Ranasul atua em todo o estado do Rio grande do Sul, com os melhores produtos e com um atendimento diferenciado. Nossos produtos são distribuídos e embalados sob a supervisão de um profissional capacitado onde se garante uma carne de rã congelada com validade superior a um ano. Todos os produtos são embalados a vácuo com embalagem individual interna. A carne de rã Ranasul vem em embalagens com peso médio de 400gr. sendo que a venda ocorre conforme o peso encontrado.','Serviços','Encontre aqui os serviços prestados em nosso site','serviços prestados, mercado dos sabores','servicos/','divulgacao',''),(52,'Formas de Pagamento','<a href=\"http://localhost/Mercadodossabores/divulgacao/formas-de-pagamento/\">Formas de Pagamento</a>','Formas de Pagamento','Formas de Pagamento','Formas de Pagamento','formas-de-pagamento/','divulgacao',''),(53,'Prazos de Entrega','<table><tbody><tr><td><br></td>\r\n            <td><a href=\"http://localhost/Mercadodossabores/divulgacao/prazos-de-entrega/\">Prazos de Entrega</a></td></tr></tbody></table>','Prazos de Entrega',' 	Prazos de Entrega',' 	Prazos de Entrega','prazos-de-entrega/','divulgacao',''),(54,'Novo Política de Trocas','Nova Política de Troca','Nova Política de Troca','Nova Política de Troca','Nova Política de Troca','novo-politica-de-trocas/','divulgacao','');

